import React from "react";

function Navbar() {
  return (
    <div className="nav">
      <img
        className="nav_logo"
        src="https://commons.wikimedia.org/wiki/File:Netflix_2015_logo.svg"
        alt="Nerflix Logo"
      />
    </div>
  );
}

export default Navbar;
